import React from 'react'
import classes from "../leaveMgmt/leave.module.css"
import { useState } from 'react';

const Ticket = () => {

    const [isOpen, setIsOpen] = useState(false);

  const openTicketForm = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
       <div>
      <div className={classes.page}>
        <div className={classes.lmpHeading}>
          <h1 style={{fontSize:"30px"}}>Ticket Management </h1>
        </div>
        <div className={classes.btn3btn}>
          <button className={classes.btn3} onClick={openTicketForm}>
            {isOpen ? "X" : "Leave Form"}
          </button>
        </div>
        </div>
        <hr/>
        {isOpen ? <Ticket/> : <h1>nothing yet</h1>}
        </div> 
    </div>
  )
}

export default Ticket
